// src/pages/StudentDashboard.js

import React, { useState } from "react";
import Sidebar from "../components/Sidebar";
import Header from "../components/Header";
import "./StudentDashboard.css";

export default function StudentDashboard() {
  // Get student name from local storage
  const studentName = localStorage.getItem("studentName") || "User";

  return (
    <>
      {/* TOP NAVBAR */}
      <Header />

      <div className="dashboard-container">

        {/* LEFT SIDEBAR */}
        <Sidebar />

        {/* MAIN CONTENT AREA */}
        <div className="dashboard-content">

          <h2 className="welcome-text">Welcome, {studentName}</h2>

          <h2 className="section-title">Your Recent Metrics</h2>

          <div className="metrics-grid">

            <div className="metric-box">
              <h3>Publications</h3>
              <p>7 this year</p>
            </div>

            <div className="metric-box">
              <h3>Patents Filed</h3>
              <p>5 total</p>
            </div>

            <div className="metric-box">
              <h3>Grants Received</h3>
              <p>$200,000</p>
            </div>

            <div className="metric-box">
              <h3>Research Impact Score</h3>
              <p>88</p>
            </div>

          </div>
        </div>
      </div>
    </>
  );
}
